import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../mycss/Header.css'; 
import myphoto from '../assets/turam.jpg';
import resume from '../assets/resume.png'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faExternalLinkAlt } from '@fortawesome/free-solid-svg-icons';
import { faLinkedin, faGithub } from '@fortawesome/free-brands-svg-icons';

function Header() {
  const [menuOpen, setMenuOpen] = useState(false);
  // eslint-disable-next-line
  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  const handleMenuClick = () => {
    setMenuOpen(false); // Close the menu when a menu item is clicked
  };

  return (
    <header>
      <div className="container">
        <div className='box first-box'>
          <img src={myphoto} alt="Portrait of Jayce Turambe" width="350" />
          <div className="text">
            <h2>Full-Stack Developer</h2>
            <p>Jayce Turambe</p>
            <p>
              🖐🏻 As a full-stack enthusiast, I'm deeply passionate about React.js, a leading JavaScript library for building dynamic user interfaces. Alongside React.js, I'm proficient in Node.js, Express.js, and MongoDB, forming a powerful combination for developing scalable web applications. React.js revolutionized front-end development with its component-based approach, while Node.js enables server-side JavaScript execution. Express.js simplifies web server creation, and MongoDB offers flexibility for managing data. With these tools, I'm ready to tackle challenges and bring innovative ideas to life in the digital world. 
            </p>
          </div>
          <div className='external-link-wrapper'>
            <a href="/about" onClick={handleMenuClick} className="external-link">
              <FontAwesomeIcon icon={faExternalLinkAlt} color='deepskyblue' className='icon'/>
            </a>
          </div>

        </div>

        <div className='box'>
          <div className="resume-preview">
            {/* Display a preview image of my resume */}
            <img src={resume} alt="Resume Preview" width="350"/>
          </div>
          <div className="resume-download">
            {/* Provide a link to download the PDF */}
            <p>LEARN MORE ABOUT ME</p>
            <a href="https://drive.google.com/file/d/1jtxWKFS4JZ6ZkxJHyLsGQ5_r7Hf0jZe-/view?usp=sharing" target="_blank" rel="noopener noreferrer">
            <span style={{color: 'deepskyblue', fontSize: '30px'}}>VIEW RESUME</span> <FontAwesomeIcon icon={faExternalLinkAlt} color='white'/> </a>
          </div>
        </div>

        <div className='box'>
          <div className="social-icons">
            <a href="https://www.linkedin.com/in/Jayce90" target="_blank" rel="noopener noreferrer">
              <FontAwesomeIcon icon={faLinkedin} size="7x" color="#0077B5" />
            </a>
            <a href="https://github.com/Jaycee90" target="_blank" rel="noopener noreferrer">
              <FontAwesomeIcon icon={faGithub} size="7x" color="#211F1F" />
            </a>
          </div>

          <div className="profile-link">
            {/* Provide a link to download the PDF */}
            <p>LET'S STAY CONNECTED</p>
            <Link to="/about" onClick={handleMenuClick} className="external-link">
            <span style={{color: 'deepskyblue', fontSize: '30px'}}>MY PROFILE</span> <FontAwesomeIcon icon={faExternalLinkAlt} color='white'/> </Link>
          </div>

        </div>
      </div>
    </header>
  );
}

export default Header;
